import React from "react";

const Aboutme = () => {
  return (
    <div id="aboutme">
      <img src="https://i.goopics.net/njduia.png" className="leaf"></img>
      <div className="conteneurimgaboutme">
        <img src="https://i.goopics.net/ng6tci.jpg" className="aboutmeimg" />
      </div>
      <div className="conteneurtextaboutme">
        <h2>A propos de moi :</h2>
        <p>Je m'apelle Olivia et je suis SPA Praticienne diplômée depuis 2011. Les soins proposés sont le résultat de mes 7 années d'expérience en SPA et balnéothérapie en France comme à l'étranger.</p>
        <p>Suite à cela, j'ai ressenti le besoin de faire une pause et élargir mes horizons professionnels.</p>
      </div>
    </div>
  );
};

export default Aboutme;
